import React from 'react';

const Search = () => {
  return (
    <form>
      <div className='row'>
        <div className='input-field col s12'>
          <i className='material-icons prefix'>search</i>
          <input id='search' type='search' />
          <label htmlFor='search'>Search</label>
        </div>
      </div>
    </form>
  );
};

export default Search;
